import React, { useState, useRef } from "react";

import Box from "@material-ui/core/Box";

const AStepperFormPart = (props) => {
  const [stepNum, setStepNum] = useState();
  const ref = useRef(null);
  if (stepNum === undefined) {
    const returnedStepNum = props.add_step(ref, props.title);
    setStepNum(returnedStepNum);
    console.log("step number: " + returnedStepNum);
  }

  let boxProps = {};
  console.log("active step number: " + props.active_step);
  if (stepNum !== undefined && stepNum !== props.active_step) {
    boxProps.style = { display: "none" };
    console.log("boxProp: " + JSON.stringify(boxProps));
  }

  return (
    <Box {...boxProps} ref={ref}>
      {props.children}
    </Box>
  );
};

export default AStepperFormPart;
